import React from 'react';
import ReactDOM from 'react-dom/client';
import 'bootstrap/dist/css/bootstrap.css';
import 'bootstrap/dist/js/bootstrap.bundle.min';
import './index.css';
import './assets/css/fontawesome-free/css/all.css';
import './assets/css/bootstrap/css/bootstrap.css';
import './assets/css/ruang-admin.css';
import './assets/js/jquery/jquery.min.js';
import './assets/css/bootstrap/js/bootstrap.bundle.js';
import './assets/js/jquery-easing/jquery.easing.min.js';
import './assets/js/ruang-admin.js';
import './assets/js/chart.js/Chart.min.js';
import './assets/js/demo/chart-area-demo.js';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
	<React.StrictMode>
		<App />
	</React.StrictMode>
);
